function nCard(val){
  console.log("val is")
  return(
  <Cards
    imgsrc={val.imgsrc}
    title={val.title}
    sname={val.sname}
    links={val.links}
  />);
  SData.map(nCard);
}

function App() {
  console.log(SData);
